import React from 'react';
import './App.css';
import profileImage from './profile.jpg';

function App() {
  return (
    <div className="App" style={{ background: '#1a1a1a', color: 'white', minHeight: '100vh', padding: '2rem' }}>
      <h2>Hi, I'm</h2>
      <h1 style={{ fontSize: '3rem', fontWeight: 'bold' }}>Darren</h1>
      <h3 style={{ fontSize: '1.5rem', marginTop: '1rem' }}>and I'm a <span style={{ color: '#aaa' }}>Data Engineer</span></h3>
      <div style={{ marginTop: '1.5rem' }}>
        <button style={{ marginRight: '1rem', padding: '0.5rem 1rem' }}>Download CV</button>
        <button style={{ padding: '0.5rem 1rem' }}>Contact Info</button>
      </div>
      <img src={profileImage} alt="Darren" style={{ width: '250px', borderRadius: '50%', marginTop: '2rem', boxShadow: '0 0 25px #000' }} />
    </div>
  );
}

export default App;
